# 1 ".\ListC\CLex.fsl"
 
 (* File ListC/CLex.lex
    Lexer specification for list-C, a small imperative language with lists
  *)

module CLex
  
open FSharp.Text.Lexing
open CPar;

let lexemeAsString lexbuf = 
    LexBuffer<char>.LexemeString lexbuf

(* Scan keywords as identifiers and use this function to distinguish them. *)
(* If the set of keywords is large, use a hashtable instead.               *)

let keyword s =
    match s with
    | "car"     -> CAR 
    | "cdr"     -> CDR 
    | "char"    -> CHAR 
    | "cons"    -> CONS 
    | "dynamic" -> DYNAMIC
    | "else"    -> ELSE
    | "false"   -> CSTBOOL 0
    | "if"      -> IF
    | "int"     -> INT
    | "nil"     -> NIL
    | "null"    -> NULL
    | "print"   -> PRINT
    | "println" -> PRINTLN
    | "return"  -> RETURN
    | "setcar"  -> SETCAR
    | "setcdr"  -> SETCDR     
    | "true"    -> CSTBOOL 1
    | "void"    -> VOID 
    | "while"   -> WHILE         
    | _         -> NAME s
 
let cEscape s = 
    match s with 
    | "\\\\" -> '\\'
    | "\\\"" -> '\"'
    | "\\a"  -> '\007'
    | "\\b"  -> '\008'
    | "\\t"  -> '\t'
    | "\\n"  -> '\n'
    | "\\v"  -> '\011'
    | "\\f"  -> '\012'
    | "\\r"  -> '\r'
    | _      -> failwith "Lexer error: impossible C escape"

